import{_ as t,o as e,c as r,R as a}from"./chunks/framework.c2IVng1e.js";const y=JSON.parse('{"title":"","description":"","frontmatter":{"aside":false},"headers":[],"relativePath":"translation/scripting/js-languages.md","filePath":"translation/scripting/js-languages.md","lastUpdated":1686923289000}'),l={name:"translation/scripting/js-languages.md"},i=a('<p>JavaScriptやその他多くのトランスパイラにコンパイル可能な言語のリスト</p><h2 id="目次" tabindex="-1">目次 <a class="header-anchor" href="#目次" aria-label="Permalink to &quot;目次&quot;">​</a></h2><ul><li><a href="#coffeescript--family--friends">CoffeeScript + Family &amp; Friends</a><ul><li><a href="#family-share-genes-with-coffeescript">Family (share genes with CoffeeScript)</a></li><li><a href="#friends-philosophically-related">Friends (philosophically related)</a></li></ul></li><li><a href="#javascript-extensions">JavaScript Extensions</a><ul><li><a href="#security-enforcing-javascript">Security enforcing JavaScript</a></li><li><a href="#static-typing">Static typing</a></li><li><a href="#synchronous-to-asynchronous-javascript-compilers-cps">Synchronous to Asynchronous JavaScript Compilers (CPS)</a></li><li><a href="#javascript-language-extensions">JavaScript Language Extensions</a></li></ul></li><li><a href="#ruby">Ruby</a></li><li><a href="#python">Python</a></li><li><a href="#erlang">Erlang</a></li><li><a href="#elixir">Elixir</a></li><li><a href="#perl">Perl</a></li><li><a href="#javajvm">Java/JVM</a></li><li><a href="#scala">Scala</a></li><li><a href="#c-f-net-related-languages">C#, F#, .NET related languages</a></li><li><a href="#lisp-scheme">Lisp, Scheme</a><ul><li><a href="#clojure-like">Clojure-like</a></li><li><a href="#scheme-like">Scheme-like</a></li><li><a href="#other">Other</a></li></ul></li><li><a href="#ocaml">OCaml</a></li><li><a href="#haskell">Haskell</a></li><li><a href="#smalltalk">Smalltalk</a></li><li><a href="#cc">C/C++</a></li><li><a href="#basic">Basic</a></li><li><a href="#pascal-modula-oberon">Pascal, Modula, Oberon</a></li><li><a href="#go">Go</a></li><li><a href="#multitarget">Multitarget</a></li><li><a href="#tierless-languages-produce-both-client--server">Tierless languages (produce both client &amp; server)</a></li><li><a href="#visual-programming-tools">Visual programming tools</a></li><li><a href="#sql">SQL</a></li><li><a href="#php">PHP</a></li><li><a href="#lua">Lua</a></li><li><a href="#prolog">Prolog</a></li><li><a href="#others">Others</a></li><li><a href="#tools-for-compiler-writers">Tools for Compiler Writers</a><ul><li><a href="#javascript-parsers-and-extensions">JavaScript Parsers and Extensions</a></li><li><a href="#javascript-optimizers">JavaScript Optimizers</a></li><li><a href="#javascript-parser-generators">JavaScript Parser Generators</a></li><li><a href="#javascript-ast-semantics">JavaScript AST, Semantics</a></li></ul></li></ul><h2 id="coffeescript-family-friends" tabindex="-1">CoffeeScript + Family &amp; Friends <a class="header-anchor" href="#coffeescript-family-friends" aria-label="Permalink to &quot;CoffeeScript + Family &amp; Friends&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th><th style="text-align:left;">Last commit</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://coffeescript.org/" target="_blank" rel="noreferrer">CoffeeScript</a></td><td style="text-align:left;">Unfancy JavaScript</td><td style="text-align:left;">2020-01-31</td></tr><tr><td style="text-align:left;"><a href="https://github.com/michaelficarra/CoffeeScriptRedux" target="_blank" rel="noreferrer">CoffeeScript II: The Wrath of Khan</a></td><td style="text-align:left;">Rewrite of the CS compiler</td><td style="text-align:left;">2017-04-13</td></tr></tbody></table><h3 id="family-share-genes-with-coffeescript" tabindex="-1">Family (share genes with CoffeeScript) <a class="header-anchor" href="#family-share-genes-with-coffeescript" aria-label="Permalink to &quot;Family (share genes with CoffeeScript)&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th><th style="text-align:left;">Last commit</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/satyr/coco" target="_blank" rel="noreferrer">Coco</a></td><td style="text-align:left;">A CoffeeScript dialect that aims to be more radical and practical, also acts as a test bed for features that get imported in CoffeeScript.</td><td style="text-align:left;">2014-09-28</td></tr><tr><td style="text-align:left;"><a href="http://livescript.net" target="_blank" rel="noreferrer">LiveScript</a></td><td style="text-align:left;">A fork of Coco that is much more compatible with CoffeeScript, more functional, and with more features.</td><td style="text-align:left;">2018-11-11</td></tr><tr><td style="text-align:left;"><a href="http://maxtaco.github.io/coffee-script/" target="_blank" rel="noreferrer">IcedCoffeeScript</a></td><td style="text-align:left;">A CoffeeScript dialect that adds support for <code>await</code> and <code>defer</code> keywords which simplify async control flow.</td><td style="text-align:left;">2019-11-27</td></tr><tr><td style="text-align:left;"><a href="https://github.com/fab13n/parsec-coffee-script" target="_blank" rel="noreferrer">Parsec CoffeeScript</a></td><td style="text-align:left;">CS based on parser combinators. The project&#39;s aim is to add static metaprogramming (i.e. macros + syntax extensibility) to Coffee Script (CS), similar to how Metalua adds such features to Lua. The resulting compiler, once merged with the official compiler, should be usable as a drop-in replacement for it.</td><td style="text-align:left;">2015-11-18</td></tr><tr><td style="text-align:left;"><a href="https://github.com/disnet/contracts.coffee" target="_blank" rel="noreferrer">Contracts.coffee</a></td><td style="text-align:left;">A dialect of CoffeeScript that adds built-in support for contracts.</td><td style="text-align:left;">2014-08-08</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jstrachan/coffee-script/blob/master/TypeAnnotations.md" target="_blank" rel="noreferrer">Uberscript</a></td><td style="text-align:left;">A CoffeeScript fork that adds type annotations which are compiled to Google closure compiler type annotation comments.</td><td style="text-align:left;">2013-09-16</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jiangmiao/toffee-script" target="_blank" rel="noreferrer">ToffeeScript</a></td><td style="text-align:left;">A dialect of CoffeeScript that support Asynchronous Syntax and Regexp operator =~</td><td style="text-align:left;">2018-04-02</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ich/caffeine" target="_blank" rel="noreferrer">Caffeine</a></td><td style="text-align:left;">A dialect of CoffeeScript that supports packages and classes import, useful for browser applications</td><td style="text-align:left;">2013-06-03</td></tr><tr><td style="text-align:left;"><a href="https://github.com/syg/heap.coffee" target="_blank" rel="noreferrer">heap.coffee</a></td><td style="text-align:left;">A dialect of CoffeeScript that offers a C-like type system with manual memory management</td><td style="text-align:left;">2012-05-13</td></tr><tr><td style="text-align:left;"><a href="http://emberscript.com" target="_blank" rel="noreferrer">EmberScript</a></td><td style="text-align:left;">Ember.js-infused CoffeeScript.</td><td style="text-align:left;">2015-04-02</td></tr><tr><td style="text-align:left;"><a href="https://github.com/paiq/blackcoffee" target="_blank" rel="noreferrer">BlackCoffee</a></td><td style="text-align:left;">CoffeeScript with hygienic macros. See also <a href="https://github.com/jashkenas/coffeescript/pull/3171" target="_blank" rel="noreferrer">#3171</a></td><td style="text-align:left;">2014-11-28</td></tr><tr><td style="text-align:left;"><a href="https://storymatic.zsnout.com" target="_blank" rel="noreferrer">Storymatic</a></td><td style="text-align:left;">A dialect of CoffeeScript rewritten from scratch to support typed languages.</td><td style="text-align:left;">2022-06-04</td></tr><tr><td style="text-align:left;"><a href="https://civet.dev/" target="_blank" rel="noreferrer">Civet</a></td><td style="text-align:left;">Written from scratch, aims to be 97+% compatible with existing CoffeeScript2 (via compiler pragmas) while also being 99% TS compatible.</td><td style="text-align:left;">2023-02-13</td></tr></tbody></table><h3 id="friends-philosophically-related" tabindex="-1">Friends (philosophically related) <a class="header-anchor" href="#friends-philosophically-related" aria-label="Permalink to &quot;Friends (philosophically related)&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th><th style="text-align:left;">Last commit</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/gdg/nodescript" target="_blank" rel="noreferrer">NodeScript</a></td><td style="text-align:left;">JavaScript without the Variable Declarations and Semicolons</td><td style="text-align:left;">2017-11-01</td></tr><tr><td style="text-align:left;"><a href="https://github.com/bizubee/bizubee" target="_blank" rel="noreferrer">Bizubee</a></td><td style="text-align:left;">The World&#39;s Most Intense Programming Language!</td><td style="text-align:left;">2017-02-08</td></tr><tr><td style="text-align:left;"><a href="https://github.com/weepy/kaffeine" target="_blank" rel="noreferrer">Kaffeine</a></td><td style="text-align:left;">Enhanced Syntax for JavaScript.</td><td style="text-align:left;">2012-08-21</td></tr><tr><td style="text-align:left;"><a href="https://github.com/tcdona/moescript" target="_blank" rel="noreferrer">Moescript</a></td><td style="text-align:left;">Indent-based language. The original repository at <a href="https://github.com/moescript/moescript" target="_blank" rel="noreferrer">https://github.com/moescript/moescript</a> is missing. The link is to a surviving fork.</td><td style="text-align:left;">2012-04-14</td></tr><tr><td style="text-align:left;"><a href="https://github.com/featurist/pogoscript" target="_blank" rel="noreferrer">pogoscript</a></td><td style="text-align:left;">Language that emphasises readability, handles async control flow nicely, is friendly to domain specific languages and compiles to regular JavaScript</td><td style="text-align:left;">2015-08-11</td></tr><tr><td style="text-align:left;"><a href="https://github.com/santoshrajan/lispyscript" target="_blank" rel="noreferrer">LispyScript</a></td><td style="text-align:left;">A JavaScript with Lispy syntax and Macros. <em><a href="#other" title="this item appears twice in this list; jump to its other instance">○</a></em></td><td style="text-align:left;">2020-01-28</td></tr><tr><td style="text-align:left;"><a href="https://github.com/olleicua/hcl" target="_blank" rel="noreferrer">Hot Cocoa Lisp</a></td><td style="text-align:left;">A Lisp-like language that compiles to JavaScript. <em><a href="#other" title="this item appears twice in this list; jump to its other instance">○</a></em></td><td style="text-align:left;">2015-03-15</td></tr><tr><td style="text-align:left;"><a href="https://sibilant.org/" target="_blank" rel="noreferrer">Sibilant</a></td><td style="text-align:left;">JavaScript with a lisp. <em><a href="#other" title="this item appears twice in this list; jump to its other instance">○</a></em></td><td style="text-align:left;">2017-12-20</td></tr><tr><td style="text-align:left;"><a href="http://ki-lang.org" target="_blank" rel="noreferrer">ki</a></td><td style="text-align:left;">Clojure-like syntax, <a href="http://swannodette.github.io/mori/" target="_blank" rel="noreferrer">mori</a>&#39;s immutable data structures in a few <a href="http://sweetjs.org" target="_blank" rel="noreferrer">sweet.js</a> macros. Can be intermixed with JavaScript. <em><a href="#clojure-like" title="this item appears twice in this list; jump to its other instance">○</a></em></td><td style="text-align:left;">2016-02-06</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mitranim/jisp" target="_blank" rel="noreferrer">jisp</a></td><td style="text-align:left;">A JS-native and axiomatic Lisp that focuses on the core ideas of code-as-data, S-expressions, and macros, introducing as few new concepts as possible. <em><a href="#other" title="this item appears twice in this list; jump to its other instance">○</a></em></td><td style="text-align:left;">2015-03-20</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jameskeane/ham-script" target="_blank" rel="noreferrer">Ham</a></td><td style="text-align:left;">Looks very similar to JavaScript at first, but offers (hopefully) many useful features</td><td style="text-align:left;">2013-05-27</td></tr><tr><td style="text-align:left;"><a href="http://ckknight.github.com/gorillascript/" target="_blank" rel="noreferrer">GorillaScript</a></td><td style="text-align:left;">Compile-to-JavaScript language designed to empower the user while attempting to prevent some common errors, offers Macros, optional Typing, and asynchronous syntax.</td><td style="text-align:left;">2013-07-16</td></tr><tr><td style="text-align:left;"><a href="https://github.com/AdamBrodzinski/RedScript" target="_blank" rel="noreferrer">RedScript</a></td><td style="text-align:left;">Elixir-flavored JavaScript.</td><td style="text-align:left;">2018-04-04</td></tr><tr><td style="text-align:left;"><a href="https://github.com/chaosim/daonode" target="_blank" rel="noreferrer">Daonode</a></td><td style="text-align:left;">Functional logic solver, compiler.</td><td style="text-align:left;">2015-11-26</td></tr><tr><td style="text-align:left;"><a href="https://github.com/luciotato/LiteScript" target="_blank" rel="noreferrer">LiteScript</a></td><td style="text-align:left;">Literate, highly-readable, type annotated, imperative language that compiles to JavaScript.</td><td style="text-align:left;">2018-06-22</td></tr><tr><td style="text-align:left;"><a href="https://github.com/TrigenSoftware/ColaScript" target="_blank" rel="noreferrer">ColaScript</a></td><td style="text-align:left;">Similar to Dart, CoffeeScript, Python and PHP</td><td style="text-align:left;">2015-02-03</td></tr><tr><td style="text-align:left;"><a href="https://github.com/taijiweb/taijilang" target="_blank" rel="noreferrer">Taijilang</a></td><td style="text-align:left;">A customizable and extensible language with dynamic parser and meta language.</td><td style="text-align:left;">2015-11-27</td></tr><tr><td style="text-align:left;"><a href="http://moonscript.org/" target="_blank" rel="noreferrer">MoonScript</a></td><td style="text-align:left;">MoonScript is a dynamic scripting language that compiles into Lua. The syntax of MoonScript has been heavily inspired by the syntax of CoffeeScript.</td><td style="text-align:left;">2020-02-02</td></tr><tr><td style="text-align:left;"><a href="http://www.earl-grey.io/" target="_blank" rel="noreferrer">Earl Grey</a></td><td style="text-align:left;">An extensible language with pattern matching, hygienic macros and a syntax similar to Python.</td><td style="text-align:left;">2017-08-14</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mattbierner/khepri" target="_blank" rel="noreferrer">Khepri</a></td><td style="text-align:left;">Lightweight language that reworks Javascript&#39;s syntax to be better for untyped functional-style programming.</td><td style="text-align:left;">2015-05-16</td></tr><tr><td style="text-align:left;"><a href="https://github.com/alongubkin/spider" target="_blank" rel="noreferrer">Spider</a></td><td style="text-align:left;">Spider is a programming language that compiles to JavaScript (ES5 and ES6 targets). It takes the best ideas of Go, Swift, Python, C# and CoffeeScript.</td><td style="text-align:left;">2017-10-21</td></tr><tr><td style="text-align:left;"><a href="http://script.cirru.org/" target="_blank" rel="noreferrer">CirruScript</a></td><td style="text-align:left;">Write JavaScript with indentations and polish notations, similar to S-Expression but with fewer parentheses.</td><td style="text-align:left;">2020-01-28</td></tr><tr><td style="text-align:left;"><a href="https://github.com/michaelchance/tlc" target="_blank" rel="noreferrer">TLC</a></td><td style="text-align:left;">Tag Line Commands is a inline macro language for calling+formatting javascript/coffeescript/livescript json output into HTML.</td><td style="text-align:left;">2015-07-26</td></tr><tr><td style="text-align:left;"><a href="https://github.com/batiste/CokeScript" target="_blank" rel="noreferrer">CokeScript</a></td><td style="text-align:left;">Inspired by Python and Ruby that integrates natively with the <a href="https://github.com/Matt-Esch/virtual-dom" target="_blank" rel="noreferrer">Virtual-DOM library</a></td><td style="text-align:left;">2018-07-05</td></tr><tr><td style="text-align:left;"><a href="http://imba.io/" target="_blank" rel="noreferrer">imba</a></td><td style="text-align:left;">Full-stack programming language for the Web that compiles to performant JavaScript</td><td style="text-align:left;">2020-02-26</td></tr><tr><td style="text-align:left;"><a href="http://yosbelms.github.io/cor" target="_blank" rel="noreferrer">Cor</a></td><td style="text-align:left;">Straightforward language for the Web</td><td style="text-align:left;">2016-12-11</td></tr><tr><td style="text-align:left;"><a href="https://github.com/iode-lang/iode" target="_blank" rel="noreferrer">Iode</a></td><td style="text-align:left;">A language inspired by Swift</td><td style="text-align:left;">2016-03-28</td></tr><tr><td style="text-align:left;"><a href="http://futurescript.org/" target="_blank" rel="noreferrer">FutureScript</a></td><td style="text-align:left;">A more radical, but more readable, different new language.</td><td style="text-align:left;">2018-12-11</td></tr><tr><td style="text-align:left;"><a href="https://github.com/kocisov/pearscript" target="_blank" rel="noreferrer">PearScript</a></td><td style="text-align:left;">Shorthanding JavaScript one more time.</td><td style="text-align:left;">2016-01-28</td></tr><tr><td style="text-align:left;"><a href="https://github.com/yosbelms/ramdascript" target="_blank" rel="noreferrer">RamdaScript</a></td><td style="text-align:left;">JavaScript in the Ramda way.</td><td style="text-align:left;">2018-01-23</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jweinst1/Royalscript" target="_blank" rel="noreferrer">RoyalScript</a></td><td style="text-align:left;">A functional language that has loops, types, structs, and much more.</td><td style="text-align:left;">2017-03-23</td></tr></tbody></table><h2 id="javascript-extensions" tabindex="-1">JavaScript Extensions <a class="header-anchor" href="#javascript-extensions" aria-label="Permalink to &quot;JavaScript Extensions&quot;">​</a></h2><h3 id="security-enforcing-javascript" tabindex="-1">Security enforcing JavaScript <a class="header-anchor" href="#security-enforcing-javascript" aria-label="Permalink to &quot;Security enforcing JavaScript&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://developers.google.com/caja/" target="_blank" rel="noreferrer">Caja</a></td><td style="text-align:left;">Compiles ES5/strict to ES3 and supports object-capabilities</td></tr><tr><td style="text-align:left;"><a href="http://www.adsafe.org/" target="_blank" rel="noreferrer">ADsafe</a></td><td style="text-align:left;">Client-side static verifier and API, making third party scripts safe.</td></tr><tr><td style="text-align:left;"><a href="http://jacaranda.org/" target="_blank" rel="noreferrer">Jacaranda</a></td><td style="text-align:left;">Static verifier supporting object-capabilities.</td></tr><tr><td style="text-align:left;"><a href="http://www.sitepen.com/blog/2008/08/01/secure-mashups-with-dojoxsecure/" target="_blank" rel="noreferrer">Dojo Secure</a></td><td style="text-align:left;">Framework for building secure mashups.</td></tr></tbody></table><h3 id="static-typing" tabindex="-1">Static typing <a class="header-anchor" href="#static-typing" aria-label="Permalink to &quot;Static typing&quot;">​</a></h3><p><strong>NOTE:</strong> Some of the projects listed below are also statically typed, such as mobl, GWT, JSIL, NS Basic, and Haxe.</p><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.dartlang.org/" target="_blank" rel="noreferrer">Dart</a></td><td style="text-align:left;">C/Java-like syntax with optional typing by Google.</td></tr><tr><td style="text-align:left;"><a href="http://www.typescriptlang.org/" target="_blank" rel="noreferrer">TypeScript</a></td><td style="text-align:left;">Typed superset of JavaScript by Microsoft.</td></tr><tr><td style="text-align:left;"><a href="http://www.jswebtools.org/" target="_blank" rel="noreferrer">TeJaS</a></td><td style="text-align:left;">From Brown PLT. Types for JavaScript (itself).</td></tr><tr><td style="text-align:left;"><a href="http://asmjs.org/" target="_blank" rel="noreferrer">asm.js</a></td><td style="text-align:left;">Subset of JavaScript that can be used as a low-level, efficient target language for compilers. Now included in Firefox.</td></tr><tr><td style="text-align:left;"><a href="http://www.jspplang.org/" target="_blank" rel="noreferrer">JavaScript++</a></td><td style="text-align:left;">JavaScript superset with classes, type checking, among other features</td></tr><tr><td style="text-align:left;"><a href="http://www.mascaraengine.com/" target="_blank" rel="noreferrer">Mascara</a></td><td style="text-align:left;">[commercial] Enhances JavaScript with powerful features like classes, namespaces and type-checking.</td></tr><tr><td style="text-align:left;"><a href="http://roy.brianmckenna.org/" target="_blank" rel="noreferrer">Roy</a></td><td style="text-align:left;">Tries to meld JavaScript semantics with some features common in static functional languages</td></tr><tr><td style="text-align:left;"><a href="http://elm-lang.org/" target="_blank" rel="noreferrer">Elm</a></td><td style="text-align:left;">Type-safe functional language that compiles to HTML, CSS, and JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://cheersgames.com/swym/wiki/index.php?title=Main_Page" target="_blank" rel="noreferrer">Swym</a></td><td style="text-align:left;">Statically typed, with type inference and generics</td></tr><tr><td style="text-align:left;"><a href="http://typecastjs.org" target="_blank" rel="noreferrer">Typecast.js</a></td><td style="text-align:left;">JavaScript platform for statically typed variables without a custom compiler.</td></tr><tr><td style="text-align:left;"><a href="http://purescript.org" target="_blank" rel="noreferrer">PureScript</a></td><td style="text-align:left;">A small, strongly typed programming language that compiles to JavaScript and C++, featuring extensible records and effects, and type classes.</td></tr><tr><td style="text-align:left;"><a href="http://flowtype.org" target="_blank" rel="noreferrer">Flow</a></td><td style="text-align:left;">Static type checker for JavaScript, supports optional types and null checks by Facebook.</td></tr><tr><td style="text-align:left;"><a href="http://royale.apache.org/download/" target="_blank" rel="noreferrer">ActionScript</a></td><td style="text-align:left;">With Apache Royale ASJS (formerly FlexJS) - Based on ECMAScript 4, ActionScript provides typing and can be compiled to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://rescript-lang.org/" target="_blank" rel="noreferrer">ReScript</a></td><td style="text-align:left;">(Formerly BuckleScript) Compiles OCaml, and its syntax extension <a href="https://reasonml.github.io/" target="_blank" rel="noreferrer">Reason</a>, to readable JavaScript, enabling powerful static type-checking, among other features. <em><a href="#OCaml" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr></tbody></table><h3 id="synchronous-to-asynchronous-javascript-compilers-cps" tabindex="-1">Synchronous to Asynchronous JavaScript Compilers (CPS) <a class="header-anchor" href="#synchronous-to-asynchronous-javascript-compilers-cps" aria-label="Permalink to &quot;Synchronous to Asynchronous JavaScript Compilers (CPS)&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/Sage/streamlinejs" target="_blank" rel="noreferrer">Streamline.js</a></td><td style="text-align:left;">Uses underscore (_) to stand for callbacks. This <a href="https://github.com/willconant/streamlinejs" target="_blank" rel="noreferrer">fork</a> preserves line numbers for debugging.</td></tr><tr><td style="text-align:left;"><a href="http://www.mobl-lang.org" target="_blank" rel="noreferrer">mobl</a></td><td style="text-align:left;">The new language for programming the mobile web.</td></tr><tr><td style="text-align:left;"><a href="http://onilabs.com/stratifiedjs/" target="_blank" rel="noreferrer">StratifiedJS</a></td><td style="text-align:left;">JavaScript + structured concurrency.</td></tr><tr><td style="text-align:left;"><a href="http://www.neilmix.com/narrativejs/doc/" target="_blank" rel="noreferrer">NarrativeJS</a></td><td style="text-align:left;">JavaScript extension with asynchronous futures and promises.</td></tr><tr><td style="text-align:left;"><a href="http://chumsley.org/jwacs/" target="_blank" rel="noreferrer">jwacs</a></td><td style="text-align:left;">JavaScript With Advanced Continuation Support.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/JeffreyZhao/wind" target="_blank" rel="noreferrer">Wind.js</a></td><td style="text-align:left;">Wind.js is an advanced library which enable us to control flow with plain JavaScript for asynchronous programming (and more) without additional pre-compiling steps.</td></tr><tr><td style="text-align:left;"><a href="http://tamejs.org/" target="_blank" rel="noreferrer">TameJS</a></td><td style="text-align:left;">Adds new keywords &#39;await&#39; and &#39;defer&#39;</td></tr><tr><td style="text-align:left;"><a href="https://github.com/BYVoid/continuation" target="_blank" rel="noreferrer">Continuation.js</a></td><td style="text-align:left;">A lightweight JIT compiler for simplifying asynchronous JavaScript programming with no runtime dependences. It supports both Node.js and browser-side JavaScript and is compatible with CoffeeScript (also TypeScript, and any other scripts compile to js).</td></tr><tr><td style="text-align:left;"><a href="http://rzimmerman.github.io/kal/" target="_blank" rel="noreferrer">Kal</a></td><td style="text-align:left;">Makes asynchronous programming easy and clean by allowing functions to pause and wait for I/O, replacing an awkward callback syntax with a clean, simple syntax</td></tr><tr><td style="text-align:left;"><a href="http://jspipe.org" target="_blank" rel="noreferrer">JSPipe</a></td><td style="text-align:left;">Provides JavaScript primitives to write async code without callbacks or chained functions. Inspired by Goroutines and Channels found in Go and in Clojure. For Web and NodeJS. ES5 and ES6.</td></tr><tr><td style="text-align:left;"><a href="http://promise-land.net" target="_blank" rel="noreferrer">promiseLand</a></td><td style="text-align:left;">PromiseLand is a very promising Language. It includes ES5 strict mode, uses the * dereferencing operator to access promise results and introduces additional features designed to let you focus on your program logic. Such as dynamic typesafety, frame addressing, generic load and safe features.</td></tr></tbody></table><h3 id="javascript-language-extensions" tabindex="-1">JavaScript Language Extensions <a class="header-anchor" href="#javascript-language-extensions" aria-label="Permalink to &quot;JavaScript Language Extensions&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.hpi.uni-potsdam.de/hirschfeld/trac/Cop/wiki/ContextJS" target="_blank" rel="noreferrer">ContextJS</a></td><td style="text-align:left;">An implementation of <a href="http://www.hpi.uni-potsdam.de/hirschfeld/cop/" target="_blank" rel="noreferrer">Context-oriented Programming</a> for JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://www.cappuccino.dev/learn/objective-j.html" target="_blank" rel="noreferrer">Objective-J</a></td><td style="text-align:left;">Shares with JavaScript the same relationship that Objective-C has with the C programming language: that of being a strict, but small, superset.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jeffsu/mochiscript" target="_blank" rel="noreferrer">Mochiscript</a></td><td style="text-align:left;">Object-oriented JavaScript with syntactic sugar. Released as a Ruby gem.</td></tr><tr><td style="text-align:left;"><a href="http://www.jangaroo.net/home/" target="_blank" rel="noreferrer">jangaroo</a></td><td style="text-align:left;">AS3 (ActionScript) to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://flapjax-lang.org/" target="_blank" rel="noreferrer">Flapjax</a></td><td style="text-align:left;">Event-driven, reactive evaluation.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jmbrito01/jlang" target="_blank" rel="noreferrer">jLang</a></td><td style="text-align:left;">Adds object oriented syntax, namespaces, operators overriding</td></tr><tr><td style="text-align:left;"><a href="http://restrictmode.org/" target="_blank" rel="noreferrer">Restrict Mode</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://www.codeproject.com/KB/recipes/TIScript.aspx" target="_blank" rel="noreferrer">TIScript</a></td><td style="text-align:left;">Gentle extension of JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/matthewrobb/six" target="_blank" rel="noreferrer">Six</a></td><td style="text-align:left;">Six is a language super-set of JavaScript that enables new syntactic features from the 6th edition of ECMAScript to be used, through a transpiler, in your scripts today.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/janpaul123/jsdares/tree/master/app/jsmm-applet/jsmm" target="_blank" rel="noreferrer">js--</a></td><td style="text-align:left;">JavaScript subset for <a href="http://www.jsdares.com/blindfold" target="_blank" rel="noreferrer">interactive/visual programming</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/tehsenaus/latte-js/" target="_blank" rel="noreferrer">Latte JS</a></td><td style="text-align:left;">Superset of JavaScript (eventually ES6), with similar goals to CoffeeScript, but keeping JS syntax.</td></tr><tr><td style="text-align:left;"><a href="http://facebook.github.io/react/docs/jsx-in-depth.html" target="_blank" rel="noreferrer">JSX</a></td><td style="text-align:left;">A superset to add an XML-like syntax to represent HTML elements in React by Facebook</td></tr><tr><td style="text-align:left;"><a href="https://github.com/musictheory/oj" target="_blank" rel="noreferrer">oj</a></td><td style="text-align:left;">Objective-C inspired superset of JavaScript with a tiny runtime, built-in obfuscator, and experimental type checker (courtesy of Typescript).</td></tr><tr><td style="text-align:left;"><a href="https://github.com/awto/mfjs-compiler" target="_blank" rel="noreferrer">mfjs</a></td><td style="text-align:left;">Adds arbitrary side effects not already available in JavaScript. They may include but not limited to delimited continuations, asynchronous, logic, reactive, parallel, distributed and probabilistic programming. It doesn&#39;t extend syntax so it may be used with any other language compiling to JavaScript.</td></tr></tbody></table><h2 id="ruby" tabindex="-1">Ruby <a class="header-anchor" href="#ruby" aria-label="Permalink to &quot;Ruby&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://opalrb.com/" target="_blank" rel="noreferrer">Opal</a></td><td style="text-align:left;">Ruby to JavaScript compiler.</td></tr><tr><td style="text-align:left;"><a href="http://hotruby.yukoba.jp/" target="_blank" rel="noreferrer">HotRuby</a></td><td style="text-align:left;">Runs opcode, compiled by YARV on Ruby inside a web browser or in Flash.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/whitequark/coldruby" target="_blank" rel="noreferrer">ColdRuby</a></td><td style="text-align:left;">Compiler of Ruby 1.9 MRI bytecode, and a runtime written in JavaScript to aid in execution of Ruby code.</td></tr><tr><td style="text-align:left;"><a href="http://rb2js.rubyforge.org/" target="_blank" rel="noreferrer">rb2js</a></td><td style="text-align:left;">Converts Ruby to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://rubyjs.org/" target="_blank" rel="noreferrer">RubyJS</a></td><td style="text-align:left;">A successor to rb2js</td></tr><tr><td style="text-align:left;"><a href="https://github.com/backtik/red" target="_blank" rel="noreferrer">Red</a></td><td style="text-align:left;">Writes like Ruby and runs like JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.playmycode.com/docs/quby" target="_blank" rel="noreferrer">Quby</a></td><td style="text-align:left;">Used for game coding site, <a href="https://github.com/PlayMyCode/Quby" target="_blank" rel="noreferrer">open source</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mattknox/8ball" target="_blank" rel="noreferrer">8ball</a></td><td style="text-align:left;">Ruby-to-JavaScript source-to-source transformer</td></tr><tr><td style="text-align:left;"><a href="https://github.com/rubys/ruby2js" target="_blank" rel="noreferrer">Ruby2JS</a></td><td style="text-align:left;">Minimal yet extensible Ruby to JavaScript conversion.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/peter-leonov/ruby-parser.js" target="_blank" rel="noreferrer">ruby-parser.js</a></td><td style="text-align:left;">Original Ruby 2.0 parser ported to pure JavaScript, produces AST</td></tr></tbody></table><h2 id="python" tabindex="-1">Python <a class="header-anchor" href="#python" aria-label="Permalink to &quot;Python&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/iodide-project/pyodide" target="_blank" rel="noreferrer">Pyodide</a></td><td style="text-align:left;">CPython, the reference Python implementation, compiled to WASM. Also includes the Python scientific stack.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/andrewschaaf/pyxc-pj/" target="_blank" rel="noreferrer">PYXC-PJ</a></td><td style="text-align:left;">[CS friend] Python to JS. Can generate a (line/col)-number mappings file. (Dead. Last updated 8 years ago.)</td></tr><tr><td style="text-align:left;"><a href="http://pyjs.org/" target="_blank" rel="noreferrer">Pyjamas</a></td><td style="text-align:left;">Python to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/chrivers/pyjaco" target="_blank" rel="noreferrer">Pyjaco</a></td><td style="text-align:left;">Python to JavaScript compiler with module support.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/anandology/pyjs" target="_blank" rel="noreferrer">Pyjs</a></td><td style="text-align:left;">Python to (readable) JS.</td></tr><tr><td style="text-align:left;"><a href="http://www.skulpt.org/" target="_blank" rel="noreferrer">Skulpt</a></td><td style="text-align:left;">Python. Client side.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/p2k/PyCow" target="_blank" rel="noreferrer">PyCow</a></td><td style="text-align:left;">Python to MooTools JS.</td></tr><tr><td style="text-align:left;"><a href="http://www.allbuttonspressed.com/blog/django/2010/07/PyvaScript-Pythonic-syntax-for-your-browser" target="_blank" rel="noreferrer">PyvaScript</a></td><td style="text-align:left;">Python-like syntax to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/atsepkov/RapydScript" target="_blank" rel="noreferrer">RapydScript</a></td><td style="text-align:left;">JavaScript with a Pythonic syntax.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ahmedaliadeel/bulbul" target="_blank" rel="noreferrer">Bulbul</a></td><td style="text-align:left;">Python3 to JavaScript/ES6/ES7 compiler. Apparently the only Python-to-JS compiler intended to provide support for AngularJS, React, Aurelia and other modern JS libs.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/brython-dev/brython" target="_blank" rel="noreferrer">Brython</a></td><td style="text-align:left;">Browser Python. Embed Python 3 in &lt;script type=&quot;text/python&quot;&gt;</td></tr><tr><td style="text-align:left;"><a href="http://apppyjs.appspot.com/" target="_blank" rel="noreferrer">PythonScript</a></td><td style="text-align:left;">Python-like compiled to JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/DenerosArmy/pythonscript" target="_blank" rel="noreferrer">pythonscript</a></td><td style="text-align:left;">Python compiled to readable JavaScript using the AST. (proof of concept)</td></tr><tr><td style="text-align:left;"><a href="https://github.com/rusthon/Rusthon" target="_blank" rel="noreferrer">Rusthon</a></td><td style="text-align:left;">Integrates several python to js methods into one project. <s>Very Active.</s> Dead since 2016. Not only for JS &amp; Py, but also Go, C, Nim, etc.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/pypyjs/pypyjs" target="_blank" rel="noreferrer">PyPyJS</a></td><td style="text-align:left;">PyPy. Compiled into JavaScript using Emscripten. JIT-compiling to JavaScript at runtime.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/pybee/batavia" target="_blank" rel="noreferrer">Batavia</a></td><td style="text-align:left;">Run Python bytecode in the browser</td></tr><tr><td style="text-align:left;"><a href="http://www.transcrypt.org" target="_blank" rel="noreferrer">Transcrypt</a></td><td style="text-align:left;">New Python 3.5 to JavaScript transpiler. Supports multiple inheritance, bound function assignment, selective operator overloading, highly readable JS output, sourcemaps, small downloads, fast execution using call memoizing. Integrated with closure compiler / minifier, optional static checker and fabric.js graphics lib for HTML5 canvas.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/alehander42/pseudo-python" target="_blank" rel="noreferrer">pseudo-python</a></td><td style="text-align:left;">A restricted python to javascript/c#/go/ruby compiler</td></tr><tr><td style="text-align:left;"><a href="https://github.com/azazel75/metapensiero.pj" target="_blank" rel="noreferrer">JavaScripthon</a></td><td style="text-align:left;">Transpile Python3.5 to ES6 and to ES5 (with the help of BabelJS, but w/o the need for nodejs). Supports classes, generators, async functions.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/flexxui/pscript" target="_blank" rel="noreferrer">PScript</a></td><td style="text-align:left;">Python compiled to JavaScript.</td></tr></tbody></table><h2 id="erlang" tabindex="-1">Erlang <a class="header-anchor" href="#erlang" aria-label="Permalink to &quot;Erlang&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://synrc.com/apps/n2o/doc/web/macros.htm" target="_blank" rel="noreferrer">Shen</a></td><td style="text-align:left;">First and yet smallest Erlang JavaScript Compiler based on Erlang AST. It allows you to translate Elixir, Joxa, <a href="https://github.com/b0oh/lol" target="_blank" rel="noreferrer">Lol</a> and Erlang programs to JavaScript with erlc. <a href="http://synrc.github.io/shen/" target="_blank" rel="noreferrer">JavaScript/OTP subset</a>. Has node npm package called <a href="https://www.npmjs.org/package/erlang-shen-js" target="_blank" rel="noreferrer">erlang-shen-js</a>.</td></tr><tr><td style="text-align:left;"><a href="http://luvv.ie" target="_blank" rel="noreferrer">LuvvieScript</a></td><td style="text-align:left;">A browser-based dom-scripting language that is a strict sub-set of Erlang which is AST-to-AST transpiled to JavaScript (<a href="https://github.com/hypernumbers/luvviescript" target="_blank" rel="noreferrer">code</a>)</td></tr><tr><td style="text-align:left;"><a href="http://svahne.github.com/browserl/" target="_blank" rel="noreferrer">browserl</a></td><td style="text-align:left;">Erlang Emulator written in JavaScript</td></tr></tbody></table><h2 id="elixir" tabindex="-1">Elixir <a class="header-anchor" href="#elixir" aria-label="Permalink to &quot;Elixir&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/bryanjos/elixirscript" target="_blank" rel="noreferrer">ElixirScript</a></td><td style="text-align:left;">Converts Elixir AST to JavaScript AST to JavaScript code.</td></tr></tbody></table><h2 id="perl" tabindex="-1">Perl <a class="header-anchor" href="#perl" aria-label="Permalink to &quot;Perl&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/fglock/Perlito" target="_blank" rel="noreferrer">Perlito</a></td><td style="text-align:left;">Project to compile Perl 5/6 to JavaScript, Ruby, SBCL, and Go.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/urandom/p2js" target="_blank" rel="noreferrer">p2js</a></td><td style="text-align:left;">Perl to JavaScript converter</td></tr><tr><td style="text-align:left;"><a href="https://github.com/gfx/perl.js" target="_blank" rel="noreferrer">perl.js</a></td><td style="text-align:left;"></td></tr></tbody></table><h2 id="java-jvm" tabindex="-1">Java/JVM <a class="header-anchor" href="#java-jvm" aria-label="Permalink to &quot;Java/JVM&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.gwtproject.org/" target="_blank" rel="noreferrer">GWT</a></td><td style="text-align:left;">Google Web Toolkit, compiles Java to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/BobHanson/java2script" target="_blank" rel="noreferrer">Java2Script/SwingJS</a></td><td style="text-align:left;">Eclipse Java to JavaScript compiler plugin and JavaScript version of the Java 8 JVM for Java applets and applications, with over 2300+ Java8 OpenJDK classes, including gnu.jpdf, gov.nist.jama, java(applet, awt, beans, io, lang, math, net, nio, security, text, util), javax(imageio, net, print, sound, swing, xml), netscape(javascript), org(apache, json, unicode, xml), sun(applet, audio, awt, net, nio, reflect, security, swing, text, util), along with an extensive library of plaf (Plaform Look and Feel) for HTML5; tested successfully on over 400,000 lines of original working Java code in 2 major (150,000+ line) applications (<a href="https://github.com/BobHanson/Jmol-SwingJS" target="_blank" rel="noreferrer">Jmol</a> and <a href="http://www.jalview.org/jalview-js/" target="_blank" rel="noreferrer">Jalview</a>) 600+ applets and 1000+ web pages in multiple projects; nearly complete AWT and Swing implementations; actively developed (since 2012); requires minor Java-compatible code adjustment to handle multithreading and modal dialogs; extensive developer documentation and support; beta</td></tr><tr><td style="text-align:left;"><a href="https://github.com/decatur/j2js-compiler" target="_blank" rel="noreferrer">j2js</a></td><td style="text-align:left;">Java bytecode to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://st-js.github.io/" target="_blank" rel="noreferrer">Strongly-Typed JavaScript (STJS)</a></td><td style="text-align:left;">JavaScript code generator from Java source. It is built as a Maven plugin.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/nurv/BicaVM" target="_blank" rel="noreferrer">BicaJVM</a></td><td style="text-align:left;">JavaScript implementation of JVM.</td></tr><tr><td style="text-align:left;"><a href="http://int3.github.com/doppio/about.html" target="_blank" rel="noreferrer">Doppio</a></td><td style="text-align:left;">JVM interpreter on CoffeeScript.</td></tr><tr><td style="text-align:left;"><a href="http://processingjs.org/" target="_blank" rel="noreferrer">Processing.js</a></td><td style="text-align:left;">A Java-based visualization language that interprets to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://kotlinlang.org" target="_blank" rel="noreferrer">Kotlin</a></td><td style="text-align:left;">Statically typed programming language targeting the JVM and JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://ceylon-lang.org/" target="_blank" rel="noreferrer">Ceylon</a></td><td style="text-align:left;">A modular static-typed JVM language compilable to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://grooscript.org/" target="_blank" rel="noreferrer">GrooScript</a></td><td style="text-align:left;">A framework to convert Groovy code to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/YaroslavGaponov/node-jvm" target="_blank" rel="noreferrer">node-jvm</a></td><td style="text-align:left;">Java virtual machine in pure node.js</td></tr><tr><td style="text-align:left;"><a href="http://wiki.apidesign.org/wiki/Bck2Brwsr" target="_blank" rel="noreferrer">Bck2Brwsr</a></td><td style="text-align:left;">Run &quot;browserified&quot; Java Code in, well, the browser.</td></tr><tr><td style="text-align:left;"><a href="http://qooxdoo.org/contrib/project/qwt" target="_blank" rel="noreferrer">QWT</a></td><td style="text-align:left;">QWT consists of a Java-to-JavaScript compiler, a prepared library of Qooxdoo componente (version 0.7.x) and some other tools. Similar to GWT</td></tr><tr><td style="text-align:left;"><a href="https://github.com/konsoletyper/teavm" target="_blank" rel="noreferrer">TeaVM</a></td><td style="text-align:left;">An ahead-of-time transpiler that takes JVM bytecode and produces JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://www.dragome.com/" target="_blank" rel="noreferrer">Dragome SDK</a></td><td style="text-align:left;">Compiles JVM bytecode to Javascript.</td></tr><tr><td style="text-align:left;"><a href="http://www.jsweet.org/" target="_blank" rel="noreferrer">JSweet</a></td><td style="text-align:left;">A Java to JavaScript transpiler built on top of TypeScript and giving access to hundreds of JavaScript libraries in Java.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/google/j2cl" target="_blank" rel="noreferrer">j2cl</a></td><td style="text-align:left;">Compiles Java to Javascript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/leaningtech/cheerpj-meta" target="_blank" rel="noreferrer">CheerpJ</a></td><td style="text-align:left;">convert Java bytecode to WebAssembly and JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mirkosertic/Bytecoder" target="_blank" rel="noreferrer">Bytecoder</a></td><td style="text-align:left;">Framework to interpret and transpile JVM bytecode to JavaScript, OpenCL or WebAssembly.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/i-net-software/JWebAssembly" target="_blank" rel="noreferrer">JWebAssembly</a></td><td style="text-align:left;">Java bytecode to WebAssembly compiler (note: you then could use <a href="https://github.com/WebAssembly/binaryen" target="_blank" rel="noreferrer">binaryen</a>&#39;s wasm2js to compile WebAssembly to JavaScript.)</td></tr><tr><td style="text-align:left;"><a href="https://github.com/martin-pabst/Online-IDE" target="_blank" rel="noreferrer">Online-IDE</a></td><td style="text-align:left;">A java-like programming language with IDE for computer-science-education that runs inside any browser</td></tr></tbody></table><h2 id="scala" tabindex="-1">Scala <a class="header-anchor" href="#scala" aria-label="Permalink to &quot;Scala&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.scala-js.org/" target="_blank" rel="noreferrer">Scala.js</a></td><td style="text-align:left;">The official Scala to JavaScript compiler</td></tr><tr><td style="text-align:left;"><a href="https://github.com/js-scala/js-scala" target="_blank" rel="noreferrer">js-scala</a></td><td style="text-align:left;">JavaScript as an embedded DSL in Scala</td></tr><tr><td style="text-align:left;"><a href="http://scalagwt.github.io/" target="_blank" rel="noreferrer">scalagwt</a></td><td style="text-align:left;">Enhanced GWT (accepts jribble as well as Java) plus Scala to jribble.</td></tr><tr><td style="text-align:left;"><a href="http://jscala.org" target="_blank" rel="noreferrer">JScala</a></td><td style="text-align:left;">Scala macro that produces JavaScript from Scala code.</td></tr></tbody></table><h2 id="c-f-net-related-languages" tabindex="-1">C#, F#, .NET related languages <a class="header-anchor" href="#c-f-net-related-languages" aria-label="Permalink to &quot;C#, F#, .NET related languages&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://jsc.sourceforge.net/" target="_blank" rel="noreferrer">jsc</a></td><td style="text-align:left;">[experimental] Recompile your .NET assembly to JavaScript, ActionScript, PHP or Java.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/kevingadd/JSIL" target="_blank" rel="noreferrer">JSIL</a></td><td style="text-align:left;">MSIL (.NET bytecode) to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://scriptsharp.com" target="_blank" rel="noreferrer">Script#</a></td><td style="text-align:left;">Compiles C# to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/markusjohnsson/cil.js" target="_blank" rel="noreferrer">CilJs</a></td><td style="text-align:left;">Translates CIL/MSIL (.NET bytecode) (C#) to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.toptensoftware.com/prefix/" target="_blank" rel="noreferrer">Prefix</a></td><td style="text-align:left;">Defunct</td></tr><tr><td style="text-align:left;"><a href="https://github.com/vannatech/blade" target="_blank" rel="noreferrer">Blade</a></td><td style="text-align:left;">Visual Studio add-on for converting C# to JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/SharpKit/SharpKit" target="_blank" rel="noreferrer">SharpKit</a></td><td style="text-align:left;">C# to JavaScript Cross-Compiler</td></tr><tr><td style="text-align:left;"><a href="http://www.saltarelle-compiler.com/" target="_blank" rel="noreferrer">Saltarelle</a></td><td style="text-align:left;">C# to JavaScript Compiler. Saltarelle is now part of <a href="http://bridge.net/" target="_blank" rel="noreferrer">Bridge.NET</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ZachBray/FunScript/" target="_blank" rel="noreferrer">FunScript</a></td><td style="text-align:left;">F# to JavaScript compiler with JQuery etc. mappings through a TypeScript type provider</td></tr><tr><td style="text-align:left;"><a href="https://github.com/tpetricek/pitfw" target="_blank" rel="noreferrer">Pit</a></td><td style="text-align:left;">F# to JavaScript compiler</td></tr><tr><td style="text-align:left;"><a href="http://www.websharper.com/" target="_blank" rel="noreferrer">WebSharper</a></td><td style="text-align:left;">Lets you compile F# to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/NemerleWeb/NemerleWeb/" target="_blank" rel="noreferrer">NemerleWeb</a></td><td style="text-align:left;">Nemerle language compiled to JS.</td></tr><tr><td style="text-align:left;"><a href="https://www.assembla.com/spaces/bluestorm/wiki/" target="_blank" rel="noreferrer">Blue Storm</a></td><td style="text-align:left;">F# to JavaScript (and some other languages).</td></tr><tr><td style="text-align:left;"><a href="http://jscriptsuite.com/" target="_blank" rel="noreferrer">JScriptSuite</a></td><td style="text-align:left;">.NET to JavaScript compiler (cross browser API, client site controls and components).</td></tr><tr><td style="text-align:left;"><a href="https://github.com/chrisdunelm/DotNetWebToolkit" target="_blank" rel="noreferrer">DotNetWebToolkit</a></td><td style="text-align:left;">Toolkit providing a .NET CIL to JavaScript transcoder and Visual Studio project/debugging integration</td></tr><tr><td style="text-align:left;"><a href="https://github.com/praeclarum/Netjs" target="_blank" rel="noreferrer">Netjs</a></td><td style="text-align:left;">.NET to TypeScript and JavaScript compiler. It uses multiple stages to produce JavaScript for your web apps.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/kswoll/WootzJs" target="_blank" rel="noreferrer">WootzJs</a></td><td style="text-align:left;">C# to Javascript cross-compiler built on top of Microsoft Roslyn, which handles the complex process of converting your C# code into syntax trees with symbol information</td></tr><tr><td style="text-align:left;"><a href="http://bridge.net/" target="_blank" rel="noreferrer">Bridge.NET</a></td><td style="text-align:left;">Open Source C#-to-JavaScript compiler using <a href="https://github.com/dotnet/roslyn" target="_blank" rel="noreferrer">Microsoft Roslyn</a>. Includes support for jQuery + many other frameworks. Developed and well supported by a professional team. Try online at <a href="http://deck.net" target="_blank" rel="noreferrer">Deck.NET</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/fsprojects/Fable" target="_blank" rel="noreferrer">Fable</a></td><td style="text-align:left;">F# to JavaScript Compiler</td></tr></tbody></table><h2 id="lisp-scheme" tabindex="-1">Lisp, Scheme <a class="header-anchor" href="#lisp-scheme" aria-label="Permalink to &quot;Lisp, Scheme&quot;">​</a></h2><h3 id="clojure-like" tabindex="-1">Clojure-like <a class="header-anchor" href="#clojure-like" aria-label="Permalink to &quot;Clojure-like&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/clojure/clojurescript" target="_blank" rel="noreferrer">ClojureScript</a></td><td style="text-align:left;">Clojure to JS, the official version. Supports the majority of Clojure including persistent datastructures.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/kriyative/clojurejs" target="_blank" rel="noreferrer">ClojureJS</a></td><td style="text-align:left;">Subset of Clojure to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/chlorinejs/chlorine" target="_blank" rel="noreferrer">Chlorinejs</a></td><td style="text-align:left;">A fork of ClojureJS with a port of clojure.core library.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/Gozala/wisp" target="_blank" rel="noreferrer">wisp</a></td><td style="text-align:left;">A homoiconic JavaScript dialect with Clojure syntax, S-expressions and macros. Aims to be rich subset of Clojure(Script) that seamlessly interops with both Clojure(Script) and JavaScript. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="https://github.com/arohner/scriptjure" target="_blank" rel="noreferrer">Scriptjure</a></td><td style="text-align:left;">Library for generating JavaScript from Clojure forms.</td></tr><tr><td style="text-align:left;"><a href="http://ki-lang.org" target="_blank" rel="noreferrer">ki</a></td><td style="text-align:left;">Clojure-like syntax, <a href="http://swannodette.github.io/mori/" target="_blank" rel="noreferrer">mori</a>&#39;s immutable data structures in a few <a href="http://sweetjs.org" target="_blank" rel="noreferrer">sweet.js</a> macros. Can be intermixed with JavaScript. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="https://github.com/calcit-lang/calcit_runner.rs" target="_blank" rel="noreferrer">Calcit-js</a></td><td style="text-align:left;">A JavaScript code generator sharing ClojureScript semantics, featured macros, immutable data, and prefix notations. However, it relies on indentation-based syntax from Cirru(Script).</td></tr><tr><td style="text-align:left;"><a href="https://www.daklang.com/" target="_blank" rel="noreferrer">Dak</a></td><td style="text-align:left;">A Lisp like language that transpiles to JavaScript. “It&#39;s still JavaScript, but wearing a Lisp outfit. It&#39;s not Common Lisp or Scheme, but a bit more like Clojure or Fennel.”</td></tr></tbody></table><h3 id="scheme-like" tabindex="-1">Scheme-like <a class="header-anchor" href="#scheme-like" aria-label="Permalink to &quot;Scheme-like&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.biwascheme.org/" target="_blank" rel="noreferrer">BiwaScheme</a></td><td style="text-align:left;">Scheme(R6RS) in JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jcoglan/fargo" target="_blank" rel="noreferrer">Fargo</a></td><td style="text-align:left;">Scheme in JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://lips.js.org/" target="_blank" rel="noreferrer">LIPS</a></td><td style="text-align:left;">Scheme (R7RS) in JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/dyoo/moby-scheme" target="_blank" rel="noreferrer">Moby Scheme</a></td><td style="text-align:left;">A Scheme running in JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/patrickdlogan/nconc" target="_blank" rel="noreferrer">nconc</a></td><td style="text-align:left;">Scheme interpreter in JavaScript with stack-friendly tail calls and full call/cc</td></tr><tr><td style="text-align:left;"><a href="http://github.com/turbopape/scheje" target="_blank" rel="noreferrer">Scheje</a></td><td style="text-align:left;">A Little Scheme on Top of Clojure - compiles on Node.js and the Browser.</td></tr><tr><td style="text-align:left;"><a href="http://www-sop.inria.fr/indes/scheme2js/" target="_blank" rel="noreferrer">scheme2js</a></td><td style="text-align:left;">Scheme to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://wiki.call-cc.org/eggref/4/spock" target="_blank" rel="noreferrer">Spock</a></td><td style="text-align:left;">A Scheme to JavaScript compiler that uses Henry Baker&#39;s Cheney-on-the-MTA compilation strategy</td></tr><tr><td style="text-align:left;"><a href="http://hashcollision.org/whalesong/" target="_blank" rel="noreferrer">Whalesong</a></td><td style="text-align:left;">Racket to JS compiler</td></tr><tr><td style="text-align:left;"><a href="https://github.com/vishesh/racketscript" target="_blank" rel="noreferrer">RacketScript</a></td><td style="text-align:left;">Lightweight Racket to JavaScript compiler. The generated code is ES6, which can be translated to ES5 using Babel or Traceur.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/soegaard/urlang" target="_blank" rel="noreferrer">urlang</a></td><td style="text-align:left;">A nanopass compiler accepting Racket-like syntax</td></tr></tbody></table><h3 id="other" tabindex="-1">Other <a class="header-anchor" href="#other" aria-label="Permalink to &quot;Other&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/anko/eslisp" target="_blank" rel="noreferrer">eslisp</a></td><td style="text-align:left;">An S-expression syntax for ECMAScript/JavaScript, with Lisp-like hygienic macros that are just JS functions. Aims to be very close to JS, and highly experimental.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/manuel/edgelisp" target="_blank" rel="noreferrer">EdgeLisp</a></td><td style="text-align:left;">A Lisp in the tradition of Common Lisp</td></tr><tr><td style="text-align:left;"><a href="http://common-lisp.net/project/parenscript/" target="_blank" rel="noreferrer">Parenscript</a></td><td style="text-align:left;">Subset of Common Lisp to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/turbolent/ralph" target="_blank" rel="noreferrer">Ralph</a></td><td style="text-align:left;">Lisp-1 dialect that compiles to JavaScript, inspired by Dylan</td></tr><tr><td style="text-align:left;"><a href="https://github.com/benekastah/oppo" target="_blank" rel="noreferrer">Oppo</a></td><td style="text-align:left;">A JavaScripter&#39;s lisp. Inspired by JavaScript, Clojure and CoffeeScript. Compiler built using <a href="http://zaach.github.com/jison/docs/" target="_blank" rel="noreferrer">Jison</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/santoshrajan/lispyscript" target="_blank" rel="noreferrer">LispyScript</a></td><td style="text-align:left;">A JavaScript with Lispy syntax and Macros. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="https://github.com/jlongster/outlet" target="_blank" rel="noreferrer">Outlet</a></td><td style="text-align:left;">A simple Lisp that supports CPS and in-browser stepping debugging, and other things. In development.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/olleicua/hcl" target="_blank" rel="noreferrer">Hot Cocoa Lisp</a></td><td style="text-align:left;">A Lisp-like language that compiles to JavaScript. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="https://sibilant.org/" target="_blank" rel="noreferrer">Sibilant</a></td><td style="text-align:left;">JavaScript with a lisp. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="http://jisp.io/" target="_blank" rel="noreferrer">jisp</a></td><td style="text-align:left;">A JS-native and axiomatic Lisp that focuses on the core ideas of code-as-data, S-expressions, and macros, introducing as few new concepts as possible. <em><a href="#friends-philosophically-related" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr><tr><td style="text-align:left;"><a href="https://github.com/jscl-project/jscl" target="_blank" rel="noreferrer">JSCL</a></td><td style="text-align:left;">A Lisp-to-Javascript compiler bootstrapped from Common Lisp</td></tr><tr><td style="text-align:left;"><a href="https://github.com/LuxLang/lux" target="_blank" rel="noreferrer">Lux</a></td><td style="text-align:left;">Statically typed, functional Lisp with an ML-like module system</td></tr></tbody></table><h2 id="ocaml" tabindex="-1">OCaml <a class="header-anchor" href="#ocaml" aria-label="Permalink to &quot;OCaml&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/jaked/ocamljs" target="_blank" rel="noreferrer">Ocamljs</a></td><td style="text-align:left;">OCaml to JS.</td></tr><tr><td style="text-align:left;"><a href="http://ocsigen.org/obrowser/" target="_blank" rel="noreferrer">O&#39;Browser</a></td><td style="text-align:left;">OCaml bytecode interpreter in JS.</td></tr><tr><td style="text-align:left;"><a href="http://ocsigen.org/js_of_ocaml/" target="_blank" rel="noreferrer">Js_of_ocaml</a></td><td style="text-align:left;">OCaml bytecode to JS compiler.</td></tr><tr><td style="text-align:left;"><a href="https://rescript-lang.org/" target="_blank" rel="noreferrer">ReScript</a></td><td style="text-align:left;">(Formerly BuckleScript) Compiles OCaml, and its syntax extension <a href="https://reasonml.github.io/" target="_blank" rel="noreferrer">Reason</a>, to readable JavaScript. <em><a href="#static-typing" title="this item appears twice in this list; jump to its other instance">○</a></em></td></tr></tbody></table><h2 id="haskell" tabindex="-1">Haskell <a class="header-anchor" href="#haskell" aria-label="Permalink to &quot;Haskell&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.cs.uu.nl/wiki/bin/view/Ehc/UhcUserDocumentation#5_7_3_jscript_Core_based_JavaScr" target="_blank" rel="noreferrer">UHC</a></td><td style="text-align:left;">(Utrecht Haskell Compiler) backend converts UHC core to JavaScript, allowing the compiling of Haskell code to JS.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ghcjs/ghcjs" target="_blank" rel="noreferrer">ghcjs</a></td><td style="text-align:left;">Compile normal Haskell into JS</td></tr><tr><td style="text-align:left;"><a href="http://hackage.haskell.org/package/jmacro" target="_blank" rel="noreferrer">jmacro</a></td><td style="text-align:left;">Quasi-Quoted JS that you can insert Haskell values into (there is also <a href="http://hackage.haskell.org/package/shakespeare-js" target="_blank" rel="noreferrer">shakespeare-js</a> for that purpose), but also supports a more Haskellish syntactic version of JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/aculich/lambdascript" target="_blank" rel="noreferrer">lambdascript</a></td><td style="text-align:left;">Compile a subset of Haskell into JS</td></tr><tr><td style="text-align:left;"><a href="http://www.haskell.org/haskellwiki/Yhc/JavaScript" target="_blank" rel="noreferrer">YHC</a></td><td style="text-align:left;">(York Haskell Compiler) backend, as above but with YHC core language.</td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/jshaskell/" target="_blank" rel="noreferrer">jshaskell</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/valderman/haste-compiler" target="_blank" rel="noreferrer">haste</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/faylang/fay/wiki" target="_blank" rel="noreferrer">fay</a></td><td style="text-align:left;">A proper subset of Haskell that compiles to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://texodus.github.io/forml/index.html" target="_blank" rel="noreferrer">forml</a></td><td style="text-align:left;">A contemporary programming language intended to approximate the safety of Haskell and the expressiveness of Ruby.</td></tr></tbody></table><h2 id="smalltalk" tabindex="-1">Smalltalk <a class="header-anchor" href="#smalltalk" aria-label="Permalink to &quot;Smalltalk&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://amber-lang.net/" target="_blank" rel="noreferrer">Amber</a></td><td style="text-align:left;">Formerly known as Jtalk</td></tr><tr><td style="text-align:left;"><a href="http://clamato.net/" target="_blank" rel="noreferrer">Clamato</a></td><td style="text-align:left;">A Smalltalk dialect that is designed to operate within the JavaScript runtime.</td></tr><tr><td style="text-align:left;"><a href="http://silversmalltalk.wordpress.com/" target="_blank" rel="noreferrer">Silver Smalltalk</a></td><td style="text-align:left;">[commercial?] Smalltalk in the browser. (Still active?)</td></tr><tr><td style="text-align:left;"><a href="http://www.lively-kernel.org/" target="_blank" rel="noreferrer">Lively Kernel</a></td><td style="text-align:left;">Smalltalk/squeak-like development environment in the browser. See also <a href="http://avocadojs.com/" target="_blank" rel="noreferrer">Avocado</a>, built on top of it.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ympbyc/LittleSmallscript" target="_blank" rel="noreferrer">Little Smallscript</a></td><td style="text-align:left;">Little Smalltalk to JavaScript translator.</td></tr><tr><td style="text-align:left;"><a href="https://bertfreudenberg.github.io/SqueakJS/" target="_blank" rel="noreferrer">SqueakJS</a></td><td style="text-align:left;">Squeak VM in Javascript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/bouraqadi/PharoJS" target="_blank" rel="noreferrer">PharoJS</a></td><td style="text-align:left;">PharoJS is a <a href="http://pharo.org/" target="_blank" rel="noreferrer">Pharo</a> to JavaScript compiler and infrastructure for remote test and debugging. The goal is to enable developing apps in <a href="http://pharo.org/" target="_blank" rel="noreferrer">Pharo</a> while deploying them on top of a JavaScript engine.</td></tr></tbody></table><h2 id="c-c" tabindex="-1">C/C++ <a class="header-anchor" href="#c-c" aria-label="Permalink to &quot;C/C++&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://emscripten.org/" target="_blank" rel="noreferrer">Emscripten</a></td><td style="text-align:left;">LLVM to JavaScript compiler. LLVM is &quot;an aggressive open-source compiler for C and C++,&quot; as well as other languages.</td></tr><tr><td style="text-align:left;"><a href="http://leaningtech.com/cheerp/" target="_blank" rel="noreferrer">Cheerp</a></td><td style="text-align:left;">(formerly Duetto) &quot;compiles C++ applications to binary code and JavaScript. Based and integrated into the LLVM/clang infrastructure&quot;</td></tr><tr><td style="text-align:left;"><a href="https://github.com/lethalman/maja" target="_blank" rel="noreferrer">maja</a></td><td style="text-align:left;">Vala (gobject) to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://cluecc.sourceforge.net/" target="_blank" rel="noreferrer">Clue</a></td><td style="text-align:left;">C language compiler to different runtimes (Lua, JS, Perl 5, C, Java, CL).</td></tr><tr><td style="text-align:left;"><a href="http://lljs.org/" target="_blank" rel="noreferrer">LLJS</a></td><td style="text-align:left;">Typed dialect of JavaScript that offers a C-like type system with manual memory management</td></tr><tr><td style="text-align:left;"><a href="http://mandreel.com/" target="_blank" rel="noreferrer">Mandreel</a></td><td style="text-align:left;">Can convert C++ and Objective-C applications based on OpenGL ES to JavaScript or Action Script 3 web application.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/gasman/bonsai-c" target="_blank" rel="noreferrer">Bonsai-C</a></td><td style="text-align:left;">Convert C code to asm.js</td></tr></tbody></table><h2 id="basic" tabindex="-1">Basic <a class="header-anchor" href="#basic" aria-label="Permalink to &quot;Basic&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://www.nsbasic.com/app/" target="_blank" rel="noreferrer">NS Basic/App Studio</a></td><td style="text-align:left;">[commercial] Visual Basic-style BASIC to JavaScript compiler. Includes IDE. Targets iOS and Android</td></tr><tr><td style="text-align:left;"><a href="http://stevehanov.ca/blog/index.php?id=92/" target="_blank" rel="noreferrer">qb.js</a></td><td style="text-align:left;">An implementation of QBASIC in JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.spiderbasic.com" target="_blank" rel="noreferrer">Spiderbasic</a></td><td style="text-align:left;">[commercial] SpiderBasic is new web client-side programming language based on established BASIC rules. Its main purpose is to allow development of very complex, windowed based web applications. It provides a large commandset to handle complex and reactive GUI, 2D games, and many more in a coherent manner.</td></tr><tr><td style="text-align:left;"><a href="https://www.b4x.com/" target="_blank" rel="noreferrer">B4J</a></td><td style="text-align:left;">[free] the BANano library by Alwaysbusy transpiles B4J (Visual Basic like) code to Javascript. Possibility to extend with other javascript libraries/web frameworks by creating BANano b4xlib libraries. Allows development of PWA, Websites, Webapps.</td></tr><tr><td style="text-align:left;">Monkey (see below)</td><td style="text-align:left;"></td></tr></tbody></table><h2 id="pascal-modula-oberon" tabindex="-1">Pascal, Modula, Oberon <a class="header-anchor" href="#pascal-modula-oberon" aria-label="Permalink to &quot;Pascal, Modula, Oberon&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://op4js.optimalesystemer.no/" target="_blank" rel="noreferrer">Smart Mobile Studio</a></td><td style="text-align:left;">[commercial] Object Pascal to JavaScript compiler and Delphi like IDE that brings classes, inheritance, interfaces and more to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.elevatesoft.com/products?category=ewb" target="_blank" rel="noreferrer">Elevate Web Builder</a></td><td style="text-align:left;">[commercial] Visual development tool for web applications that compiles standard Object Pascal source code into JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/vladfolts/oberonjs" target="_blank" rel="noreferrer">Oberon 07</a></td><td style="text-align:left;">Translates Oberon to JavaScript code ready to be run in web browser or nodejs. Compiler itself is written in Oberon (with extensions) and compiled to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://wiki.freepascal.org/pas2js" target="_blank" rel="noreferrer">Pas2JS</a></td><td style="text-align:left;">Pas2js is an open source Pascal to JavaScript transpiler. It parses Object Pascal and emits JavaScript. The JavaScript is currently of level ECMAScript 5 and should run in any browser or in Node.js.</td></tr></tbody></table><h2 id="go" tabindex="-1">Go <a class="header-anchor" href="#go" aria-label="Permalink to &quot;Go&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/kless/go2js" target="_blank" rel="noreferrer">Go2js</a></td><td style="text-align:left;">Line-to-line translator from Go to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/gopherjs/gopherjs" target="_blank" rel="noreferrer">GopherJS</a></td><td style="text-align:left;">A compiler from Go to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://tardisgo.github.io" target="_blank" rel="noreferrer">TARDISgo</a></td><td style="text-align:left;">Compile Golang to Haxe (then on to JavaScript, Flash, Java, C++, C#, PHP, Python, Lua, Neko, HashLink)</td></tr></tbody></table><h2 id="multitarget" tabindex="-1">Multitarget <a class="header-anchor" href="#multitarget" aria-label="Permalink to &quot;Multitarget&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://haxe.org/" target="_blank" rel="noreferrer">Haxe</a></td><td style="text-align:left;">Compiles to several platforms C++, JavaScript, PHP, Java, JVM, C#, Python, Lua, Neko, HashLink (both JIT and C) and Flash/SWF.</td></tr><tr><td style="text-align:left;"><a href="http://fantom.org/" target="_blank" rel="noreferrer">Fantom</a></td><td style="text-align:left;">Evolutionary object-oriented language emphasizing succinct and effective APIs (JVM, CLR, JS).</td></tr><tr><td style="text-align:left;"><a href="http://labs.openlaszlo.org/trunk-nightly/laszlo-explorer/index.html?lzr=swf10#_lzbookmark=Laszlo%20in%2010%20Minutes" target="_blank" rel="noreferrer">LZX (Laszlo XML)</a></td><td style="text-align:left;">LZX is <a href="http://www.openlaszlo.org" target="_blank" rel="noreferrer">OpenLaszlo&#39;s</a> declarative user interface language, which is compiled into JavaScript 2 as an intermediary format, and further compiled into either JavaScript 1.5 or ActionScript 3.</td></tr><tr><td style="text-align:left;">Clue and jsc</td><td style="text-align:left;">Target multiple runtimes in addition to JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://nim-lang.org" target="_blank" rel="noreferrer">Nim</a></td><td style="text-align:left;">Compiles to C, C++, Objective-C, and JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.monkey-x.com/" target="_blank" rel="noreferrer">Monkey</a></td><td style="text-align:left;">A Basic-like programming language that compiles to several platforms (JavaScript, ActionScript 3, C++, Java, C#). The main application/game framework is [commercial].</td></tr><tr><td style="text-align:left;"><a href="https://www.defrac.com/" target="_blank" rel="noreferrer">defrac</a></td><td style="text-align:left;">Compiles Java bytecode to several platforms (including JavaScript)</td></tr><tr><td style="text-align:left;"><a href="https://github.com/pfusik/cito" target="_blank" rel="noreferrer">Ć Programming Language</a></td><td style="text-align:left;">Automatically translated to C, C++, C#, Java, JavaScript, Python, Swift and OpenCL.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/evanw/skew" target="_blank" rel="noreferrer">Skew</a></td><td style="text-align:left;">A web-first, cross-platform programming language with an optimizing compiler (compiles to JS and C++)</td></tr><tr><td style="text-align:left;"><a href="https://call-cc.org/" target="_blank" rel="noreferrer">Chicken Scheme</a></td><td style="text-align:left;">an R5RS &amp; R7RS Scheme that normally compiles to C. The <a href="http://wiki.call-cc.org/eggref/5/spock" target="_blank" rel="noreferrer">Spock</a> library allows compilation to JavaScript</td></tr></tbody></table><h2 id="tierless-languages-produce-both-client-server" tabindex="-1">Tierless languages (produce both client &amp; server) <a class="header-anchor" href="#tierless-languages-produce-both-client-server" aria-label="Permalink to &quot;Tierless languages (produce both client &amp; server)&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/marcuswestin/fun" target="_blank" rel="noreferrer">Fun</a></td><td style="text-align:left;">A programming language for realtime webapps - compiles to client-side and server-side JS.</td></tr><tr><td style="text-align:left;"><a href="http://impredicative.com/ur/" target="_blank" rel="noreferrer">Ur</a></td><td style="text-align:left;">In the tradition of ML and Haskell.</td></tr><tr><td style="text-align:left;"><a href="http://www.mobl-lang.org" target="_blank" rel="noreferrer">mobl</a></td><td style="text-align:left;">The new language for programming the mobile web.</td></tr><tr><td style="text-align:left;"><a href="http://wiki.erights.org/wiki/E-on-JS" target="_blank" rel="noreferrer">E</a></td><td style="text-align:left;">Compiles E to JS. E is a secure distributed persistent pure object language.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/sebastien/sugar" target="_blank" rel="noreferrer">Sugar</a></td><td style="text-align:left;">New programming language designed to replace JavaScript for client-side (and server-side) web development</td></tr><tr><td style="text-align:left;"><a href="http://opalang.org/" target="_blank" rel="noreferrer">Opa</a></td><td style="text-align:left;">Write your complete application in just one language, and the compiler will transform it into a self-sufficient executable</td></tr><tr><td style="text-align:left;"><a href="http://soft.vub.ac.be/~lphilips/jspdg/stip/stip-web/stip.html" target="_blank" rel="noreferrer">STIP.js</a></td><td style="text-align:left;">Slicing Tierless Programs in JavaScript</td></tr></tbody></table><h2 id="visual-programming-tools" tabindex="-1">Visual programming tools <a class="header-anchor" href="#visual-programming-tools" aria-label="Permalink to &quot;Visual programming tools&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://scion.scxml.io/" target="_blank" rel="noreferrer">SCION SCXML</a></td><td style="text-align:left;">Tools for W3C <a href="https://www.w3.org/TR/scxml/" target="_blank" rel="noreferrer">State Chart XML</a>, a state machine language. Tools include an SCXML-to-JS compiler and graphical debugger.</td></tr><tr><td style="text-align:left;"><a href="http://waterbearlang.com/" target="_blank" rel="noreferrer">Waterbear</a></td><td style="text-align:left;">Tool for making Scratch-inspired block-based languages on the web. Examples include blocks for JavaScript, ProcessingJS, NodeJS, and more.</td></tr><tr><td style="text-align:left;"><a href="http://snap.berkeley.edu/snapsource/snap.html" target="_blank" rel="noreferrer">Snap</a></td><td style="text-align:left;">JavaScript of BYOB, which is a fork of <a href="http://scratch.mit.edu/" target="_blank" rel="noreferrer">Scratch</a></td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/scriptblocks/" target="_blank" rel="noreferrer">ScriptBlocks</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://radicalbreeze.com/" target="_blank" rel="noreferrer">Illumination</a></td><td style="text-align:left;">[Commercial] Visual, cross-platform tool creates apps for Android, iPhone, iPad, Desktops and HTML5 or Flash websites. <a href="http://blog.radicalbreeze.com/?p=213" target="_blank" rel="noreferrer">The I language</a> underlies the tool.</td></tr><tr><td style="text-align:left;"><a href="http://jsmaker.com/jsmaker/" target="_blank" rel="noreferrer">JsMaker</a></td><td style="text-align:left;">Visual JavaScript programming</td></tr><tr><td style="text-align:left;"><a href="http://meemoo.org/" target="_blank" rel="noreferrer">Meemoo</a></td><td style="text-align:left;">Flow-based visual programming framework for hackable web apps</td></tr><tr><td style="text-align:left;"><a href="http://noflojs.org/" target="_blank" rel="noreferrer">NoFlo</a></td><td style="text-align:left;">JavaScript implementation of Flow-Based Programming. Programs (network graphs) can be visually created with <a href="http://www.jpaulmorrison.com/cgi-bin/wiki.pl?DrawFBP" target="_blank" rel="noreferrer">DrawFBP</a></td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/google-blockly/" target="_blank" rel="noreferrer">Blockly</a></td><td style="text-align:left;">Web-based, graphical programming language. Users can drag blocks together to build an application</td></tr><tr><td style="text-align:left;"><a href="http://junk.wise9.jp/maeda/" target="_blank" rel="noreferrer">Maeda Block</a></td><td style="text-align:left;">Visual game programming language powered by enchant.js and Google Blockly. See also the <a href="http://maedablock.jp/" target="_blank" rel="noreferrer">Japanese version</a>.</td></tr></tbody></table><h2 id="sql" tabindex="-1">SQL <a class="header-anchor" href="#sql" aria-label="Permalink to &quot;SQL&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/forward/sql-parser" target="_blank" rel="noreferrer">sql-parser</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/steveyen/sqld3" target="_blank" rel="noreferrer">sqld3</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/agershun/alasql" target="_blank" rel="noreferrer">Alasql</a></td><td style="text-align:left;">SQL to JavaScript parser and compiler</td></tr><tr><td style="text-align:left;"><a href="https://github.com/kripken/sql.js" target="_blank" rel="noreferrer">sql.js</a></td><td style="text-align:left;">SQLite compiled to javascript</td></tr><tr><td style="text-align:left;"><a href="https://rbql.org" target="_blank" rel="noreferrer">RBQL</a></td><td style="text-align:left;">SQL-like language that compiles to JavaScript and Python</td></tr></tbody></table><h2 id="php" tabindex="-1">PHP <a class="header-anchor" href="#php" aria-label="Permalink to &quot;PHP&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://code.google.com/p/phype/" target="_blank" rel="noreferrer">phype</a></td><td style="text-align:left;">Run PHP code directly in your browser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/asmblah/uniter" target="_blank" rel="noreferrer">uniter</a></td><td style="text-align:left;">Run PHP code in Node.js or the browser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/niklasvh/php.js" target="_blank" rel="noreferrer">php.js</a></td><td style="text-align:left;">PHP VM with JavaScript, allow to run PHP code in Node.js or the browser</td></tr></tbody></table><h2 id="lua" tabindex="-1">Lua <a class="header-anchor" href="#lua" aria-label="Permalink to &quot;Lua&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/mherkender/lua.js" target="_blank" rel="noreferrer">lua.js</a></td><td style="text-align:left;">Lua parser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/creationix/brozula" target="_blank" rel="noreferrer">Brozula</a></td><td style="text-align:left;">Lua bytecode interpreter</td></tr><tr><td style="text-align:left;"><a href="https://fengari.io/" target="_blank" rel="noreferrer">Fengari</a></td><td style="text-align:left;">Lua VM in JavaScript</td></tr></tbody></table><h2 id="prolog" tabindex="-1">Prolog <a class="header-anchor" href="#prolog" aria-label="Permalink to &quot;Prolog&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/jldupont/prolog.js" target="_blank" rel="noreferrer">prolog.js</a></td><td style="text-align:left;">Prolog parser, compiler, and interpreter in JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://yieldprolog.sourceforge.net/" target="_blank" rel="noreferrer">Yield Prolog</a></td><td style="text-align:left;">Compiles Prolog into JavaScript, C#, and Python</td></tr><tr><td style="text-align:left;"><a href="http://tau-prolog.org/" target="_blank" rel="noreferrer">Tau Prolog</a></td><td style="text-align:left;">Prolog interpreter in JavaScript</td></tr></tbody></table><h2 id="others" tabindex="-1">Others <a class="header-anchor" href="#others" aria-label="Permalink to &quot;Others&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/tiabeast/bait" target="_blank" rel="noreferrer">Bait</a></td><td style="text-align:left;">Compiled general purpose programming language with a simple syntax for building reliable software. The current main backend compiles to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/zlanguage" target="_blank" rel="noreferrer">Z</a></td><td style="text-align:left;">An experimental language that is basically JavaScript with nicer syntax.</td></tr><tr><td style="text-align:left;"><a href="https://www.pyret.org/" target="_blank" rel="noreferrer">Pyret</a></td><td style="text-align:left;">A teaching language that runs in the browser.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/stevedekorte/oia" target="_blank" rel="noreferrer">Oia</a></td><td style="text-align:left;">A port of Io to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://www.plaid-lang.org" target="_blank" rel="noreferrer">Plaid</a></td><td style="text-align:left;">A gradually-typed, typestate-oriented language designed as a better Java.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/erkyrath/quixe" target="_blank" rel="noreferrer">Quixe</a></td><td style="text-align:left;">A Glulx VM interpreter written in JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/curiousdannii/gnusto" target="_blank" rel="noreferrer">Gnusto</a></td><td style="text-align:left;">A Z-Machine VM interpreter written in JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://www.calormen.com/logo/" target="_blank" rel="noreferrer">Logo Interpreter</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/jankom/RebToStatic" target="_blank" rel="noreferrer">Reb2Static</a></td><td style="text-align:left;">Rebol to JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/adrusi/rpn" target="_blank" rel="noreferrer">RPN</a></td><td style="text-align:left;">Interpreter for a language with a Reverse Polish Notation syntax.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/brendanator/jsforth" target="_blank" rel="noreferrer">jsForth</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://solidcoding.blogspot.com/2008/12/wforth-javascript-forth-interpreter.html" target="_blank" rel="noreferrer">wForth</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://wiki.portal.chalmers.se/agda/pmwiki.php" target="_blank" rel="noreferrer">Agda</a></td><td style="text-align:left;">A dependently typed functional programming language and mechanized proof assistant</td></tr><tr><td style="text-align:left;"><a href="https://github.com/baxtree/xlcc" target="_blank" rel="noreferrer">XLCC</a></td><td style="text-align:left;">Interpret LCC into JavaScript on node</td></tr><tr><td style="text-align:left;"><a href="http://www.smlserver.org/smltojs/" target="_blank" rel="noreferrer">SMLtoJs</a></td><td style="text-align:left;">SML to JavaScript compiler</td></tr><tr><td style="text-align:left;"><a href="http://peterolson.github.com/Pygmy/Docs/index.html" target="_blank" rel="noreferrer">Pygmy</a></td><td style="text-align:left;">A dynamic language that compiles to JavaScript designed to be readable but concise enough to be competitive in code golf.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/baryluk/erlyjs" target="_blank" rel="noreferrer">ErlyJS</a></td><td style="text-align:left;">JavaScript to Erlang compiler</td></tr><tr><td style="text-align:left;"><a href="https://github.com/giesse/Project-SnowBall" target="_blank" rel="noreferrer">Topaz</a></td><td style="text-align:left;">Rebol inspired language on top of JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ngn/apl" target="_blank" rel="noreferrer">NGN APL</a></td><td style="text-align:left;">APL-to-JavaScript compiler written in CoffeeScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ajlopez/CobolScript" target="_blank" rel="noreferrer">CobolScript</a></td><td style="text-align:left;">COBOL language compiler to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/idris-lang/idris-dev" target="_blank" rel="noreferrer">Idris</a></td><td style="text-align:left;">Dependently typed functional language with a JavaScript backend.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/atennapel/Wortel" target="_blank" rel="noreferrer">Wortel</a></td><td style="text-align:left;">J/APL inspired language with Polish Notation, compiles to JavaScript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/JohnEarnest/ok" target="_blank" rel="noreferrer">oK</a></td><td style="text-align:left;">K5 implementation on top of Javascript.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/JEnglishOrg/JEnglish/" target="_blank" rel="noreferrer">JEnglish</a></td><td style="text-align:left;">Interprets regular English statements into HTML/CSS</td></tr><tr><td style="text-align:left;"><a href="https://github.com/bendc/uilang" target="_blank" rel="noreferrer">uilang</a> &amp; <a href="https://github.com/ConnorAtherton/uiscript" target="_blank" rel="noreferrer">uiscript</a></td><td style="text-align:left;">Simple UI-focused script languages for web designers</td></tr><tr><td style="text-align:left;"><a href="http://www.hodor-lang.org/" target="_blank" rel="noreferrer">Hodor</a></td><td style="text-align:left;">Hodor programming language</td></tr><tr><td style="text-align:left;"><a href="https://github.com/gjmcn/L2" target="_blank" rel="noreferrer">L2</a></td><td style="text-align:left;">A simple, table-based language for data analysis</td></tr><tr><td style="text-align:left;"><a href="https://github.com/samgozman/YoptaScript" target="_blank" rel="noreferrer">YoptaScript</a></td><td style="text-align:left;">Language for gopniks (post-Soviet aggressive young lower-class suburban male dwellers coming from families of poor education and income)</td></tr><tr><td style="text-align:left;"><a href="https://github.com/stackgl/glsl-transpiler" target="_blank" rel="noreferrer">GLSL-Transpiler</a></td><td style="text-align:left;">Compile GLSL to JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/Kindelia/Kind" target="_blank" rel="noreferrer">Kind</a></td><td style="text-align:left;">Dependently-typed, functional programming and proof language.</td></tr></tbody></table><h2 id="tools-for-compiler-writers" tabindex="-1">Tools for Compiler Writers <a class="header-anchor" href="#tools-for-compiler-writers" aria-label="Permalink to &quot;Tools for Compiler Writers&quot;">​</a></h2><h3 id="javascript-parsers-and-extensions" tabindex="-1">JavaScript Parsers and Extensions <a class="header-anchor" href="#javascript-parsers-and-extensions" aria-label="Permalink to &quot;JavaScript Parsers and Extensions&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/mozilla/narcissus/" target="_blank" rel="noreferrer">Narcissus</a></td><td style="text-align:left;">Mozilla&#39;s experimental JavaScript compiler in JavaScript by Brendan Eich and others.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mozilla/doctorjs/tree/master/lib/jsctags/narcissus" target="_blank" rel="noreferrer">CommonJS version in DoctorJS</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/wpbasti/jasy/tree/master/lib/jasy/parser" target="_blank" rel="noreferrer">Jasy: Python port of Narcissus with some enhancements</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/pynarcissus/" target="_blank" rel="noreferrer">PyNarcissus</a></td><td style="text-align:left;">Narcissus&#39;s parser ported to Python (used in <a href="http://code.google.com/p/pyjon/" target="_blank" rel="noreferrer">pyjon</a>)</td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/rbnarcissus/" target="_blank" rel="noreferrer">rbnarcissus</a></td><td style="text-align:left;">Narcissus&#39; parser ported to Ruby.</td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/traceur-compiler/" target="_blank" rel="noreferrer">Traceur</a></td><td style="text-align:left;">Google&#39;s vehicle for JavaScript Language Design Experimentation</td></tr><tr><td style="text-align:left;"><a href="http://es-lab.googlecode.com/svn/trunk/site/esparser/index.html" target="_blank" rel="noreferrer">EcmaScript 5 Parser (es-lab)</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://esparser.qfox.nl/" target="_blank" rel="noreferrer">EcmaScript 5 Parser (qfox)</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://github.com/zaach/reflect.js" target="_blank" rel="noreferrer">reflect.js</a></td><td style="text-align:left;">Implementation of Mozilla&#39;s (SpiderMonkey) <a href="https://developer.mozilla.org/en/SpiderMonkey/Parser_API" target="_blank" rel="noreferrer">Parser API</a> in JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/altoviso/bdParse" target="_blank" rel="noreferrer">bdParse</a></td><td style="text-align:left;">A JavaScript LL(1) parser in JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://marijnhaverbeke.nl/parse-js/" target="_blank" rel="noreferrer">parse-js</a></td><td style="text-align:left;">Common Lisp JavaScript parser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/qfox/ZeParser" target="_blank" rel="noreferrer">ZeParser</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="http://esprima.org" target="_blank" rel="noreferrer">Esprima</a></td><td style="text-align:left;">Educational (but fast) ECMAScript parser with output compatible to <a href="https://developer.mozilla.org/en/SpiderMonkey/Parser_API" target="_blank" rel="noreferrer">Mozilla Parser API</a></td></tr><tr><td style="text-align:left;"><a href="https://github.com/jterrace/js.js" target="_blank" rel="noreferrer">js.js</a></td><td style="text-align:left;">A JavaScript JavaScript interpreter. Instead of trying to create an interpreter from scratch, SpiderMonkey is compiled into LLVM and then emscripten translates the output into JavaScript.</td></tr><tr><td style="text-align:left;"><a href="http://sweetjs.org/" target="_blank" rel="noreferrer">sweet.js</a></td><td style="text-align:left;">Brings hygienic macros to JavaScript. Lets you write extensions to JavaScript that must be invoked by the user.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jasuperior/smpl" target="_blank" rel="noreferrer">smpl.js</a></td><td style="text-align:left;">The first compiler built for the purpose of transpiling first.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/marijnh/acorn/" target="_blank" rel="noreferrer">acorn</a></td><td style="text-align:left;">A small, fast, JavaScript-based JavaScript parser</td></tr><tr><td style="text-align:left;"><a href="https://babeljs.io/" target="_blank" rel="noreferrer">Babel</a></td><td style="text-align:left;">Turn your ES6+ code into ES5 friendly code</td></tr></tbody></table><h3 id="javascript-optimizers" tabindex="-1">JavaScript Optimizers <a class="header-anchor" href="#javascript-optimizers" aria-label="Permalink to &quot;JavaScript Optimizers&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="http://code.google.com/closure/compiler/" target="_blank" rel="noreferrer">Closure Compiler</a></td><td style="text-align:left;">An optimizing compiler. Can generate a (line/col)-number mappings file.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mishoo/UglifyJS2" target="_blank" rel="noreferrer">UglifyJS</a></td><td style="text-align:left;"></td></tr></tbody></table><h3 id="javascript-parser-generators" tabindex="-1">JavaScript Parser Generators <a class="header-anchor" href="#javascript-parser-generators" aria-label="Permalink to &quot;JavaScript Parser Generators&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://github.com/zaach/jison" target="_blank" rel="noreferrer">jison</a></td><td style="text-align:left;">Bison in JavaScript, used by CoffeeScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/hardmath123/nearley" target="_blank" rel="noreferrer">nearley</a></td><td style="text-align:left;">A fast, lightweight Earley parser generator</td></tr><tr><td style="text-align:left;"><a href="http://tinlizzie.org/ometa-js/#Sample_Project" target="_blank" rel="noreferrer">OMeta/JS</a></td><td style="text-align:left;">Metacompiler for many languages to many targets, including js. (<a href="https://github.com/veged/ometa-js" target="_blank" rel="noreferrer">source</a>)</td></tr><tr><td style="text-align:left;"><a href="http://pegjs.majda.cz/" target="_blank" rel="noreferrer">PEG.js</a></td><td style="text-align:left;">Parser generator for JavaScript based on the parsing expression grammar formalism</td></tr><tr><td style="text-align:left;"><a href="https://github.com/tolmasky/language" target="_blank" rel="noreferrer">languagejs</a></td><td style="text-align:left;">PEG parser written in JavaScript with first class errors</td></tr><tr><td style="text-align:left;"><a href="https://github.com/jcoglan/canopy" target="_blank" rel="noreferrer">Canopy</a></td><td style="text-align:left;">Self-hosting PEG parser compiler for JavaScript, influenced by Ruby parser generators such as Treetop and Citrus</td></tr><tr><td style="text-align:left;"><a href="http://jscc.phorward-software.com/" target="_blank" rel="noreferrer">JS/CC</a></td><td style="text-align:left;">LALR(1) parser generator</td></tr><tr><td style="text-align:left;"><a href="https://github.com/doublec/jsparse" target="_blank" rel="noreferrer">jsparse</a></td><td style="text-align:left;">PEG by Grandmaster Chris Double</td></tr><tr><td style="text-align:left;"><a href="https://github.com/weaver/ReParse" target="_blank" rel="noreferrer">ReParse</a></td><td style="text-align:left;">Parser combinator library for JavaScript like Haskell&#39;s Parsec</td></tr><tr><td style="text-align:left;"><a href="https://github.com/asmyczek/p4js" target="_blank" rel="noreferrer">p4js</a></td><td style="text-align:left;">Monadic parser library for JavaScript</td></tr><tr><td style="text-align:left;"><a href="http://blog.kalleberg.org/post/1256702765/prototype-of-a-scannerless-generalized-left-to-right" target="_blank" rel="noreferrer">JSGLR</a></td><td style="text-align:left;">Scannerless, Generalized Left-to-right Rightmost (SGLR) derivation parser for JavaScript</td></tr><tr><td style="text-align:left;"><a href="https://github.com/antlr/examples-v3" target="_blank" rel="noreferrer">ANTLR 3</a></td><td style="text-align:left;">Has a JavaScript target. ANTLR 4 has <a href="https://theantlrguy.atlassian.net/wiki/display/ANTLR4/Runtime+Libraries+and+Code+Generation+Targets" target="_blank" rel="noreferrer">not implemented its JavaScript target yet</a>.</td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/cruiser/wiki/Parse" target="_blank" rel="noreferrer">Cruiser.Parse</a></td><td style="text-align:left;">LL(k) parser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/xixixao/meta-coffee" target="_blank" rel="noreferrer">MetaCoffee</a></td><td style="text-align:left;">PEG parser using CoffeeScript and white-space-significant syntax</td></tr><tr><td style="text-align:left;"><a href="http://bennu-js.com" target="_blank" rel="noreferrer">Bennu</a></td><td style="text-align:left;">Parsec inspired Javascript parser combinator library.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/peter-leonov/bison-lalr1.js" target="_blank" rel="noreferrer">bison-lalr1.js</a></td><td style="text-align:left;">JavaScript skeleton for Bison GNU Parser Generator</td></tr></tbody></table><h3 id="javascript-ast-semantics" tabindex="-1">JavaScript AST, Semantics <a class="header-anchor" href="#javascript-ast-semantics" aria-label="Permalink to &quot;JavaScript AST, Semantics&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://webassembly.org/" target="_blank" rel="noreferrer">WebAssembly</a></td><td style="text-align:left;">W3C cross-browser collaboration on a new, portable, size- and load-time-efficient format suitable for compilation to the web.</td></tr><tr><td style="text-align:left;"><a href="https://docs.google.com/viewer?url=http%3A%2F%2Fclosure-compiler.googlecode.com%2Ffiles%2Fclosure-compiler-ast.pdf" target="_blank" rel="noreferrer">Closure Compiler AST Documentation</a></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://developer.mozilla.org/en/SpiderMonkey/Parser_API" target="_blank" rel="noreferrer">SpiderMonkey Parser API</a></td><td style="text-align:left;">See also reflect.js above. The AST interface specification is succeeded by the ESTree specification effort.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/estree/estree" target="_blank" rel="noreferrer">ESTree Specification</a></td><td style="text-align:left;">An effort to better standardize an AST specification based on the original Spidermonkey Parser API. It is used by Acorn, Esprima, and SpiderMonkey&#39;s own parser. This succeeds the original SpiderMonkey Parser API&#39;s AST specification.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/shapesecurity/shift-spec" target="_blank" rel="noreferrer">Shift JavaScript AST Specification</a></td><td style="text-align:left;">See this <a href="http://engineering.shapesecurity.com/2014/12/announcing-shift-javascript-ast.html" target="_blank" rel="noreferrer">blog post</a> with more information</td></tr><tr><td style="text-align:left;"><a href="http://code.google.com/p/es-lab/wiki/JsonMLASTFormat" target="_blank" rel="noreferrer">JsonML AST</a></td><td style="text-align:left;">Format used by the es5 parser</td></tr><tr><td style="text-align:left;"><a href="https://github.com/ajaxorg/treehugger" target="_blank" rel="noreferrer">treehugger</a></td><td style="text-align:left;">JavaScript AST transformation tools</td></tr><tr><td style="text-align:left;"><a href="http://jsshaper.org/" target="_blank" rel="noreferrer">JavaScript Shaper</a></td><td style="text-align:left;">JavaScript syntax tree shaping</td></tr><tr><td style="text-align:left;"><a href="https://github.com/substack/node-burrito" target="_blank" rel="noreferrer">burrito</a> &amp; <a href="https://github.com/substack/js-traverse" target="_blank" rel="noreferrer">js-traverse</a></td><td style="text-align:left;">See <a href="http://substack.net/posts/eed898" target="_blank" rel="noreferrer">this post</a> for more info, as well as <a href="https://github.com/substack/node-stackedy" target="_blank" rel="noreferrer">node-stackedy</a> for an example and <a href="https://github.com/substack/node-browserify" target="_blank" rel="noreferrer">node-browserify</a> for running it in a browser instead of node</td></tr><tr><td style="text-align:left;"><a href="https://github.com/substack/node-falafel" target="_blank" rel="noreferrer">falafel</a></td><td style="text-align:left;">Transform the ast on a recursive walk</td></tr><tr><td style="text-align:left;"><a href="https://github.com/millermedeiros/rocambole" target="_blank" rel="noreferrer">rocambole</a></td><td style="text-align:left;">Inspired by burrito &amp; falafel, recursively walk and transform EcmaScript AST</td></tr><tr><td style="text-align:left;"><a href="http://cs.brown.edu/~joe/public/types/types.html" target="_blank" rel="noreferrer">JavaScript types</a></td><td style="text-align:left;">Lambdajs and flow typing</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mozilla/source-map" target="_blank" rel="noreferrer">SourceMap</a></td><td style="text-align:left;">Map JavaScript debugger output to original source</td></tr><tr><td style="text-align:left;"><a href="https://github.com/qfox/Zeon" target="_blank" rel="noreferrer">Zeon</a></td><td style="text-align:left;">A static visual JavaScript analyzer / editor. See also <a href="https://github.com/qfox/ZeParser" target="_blank" rel="noreferrer">ZeParser</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/Constellation/escodegen" target="_blank" rel="noreferrer">escodegen</a></td><td style="text-align:left;">JavaScript code generator</td></tr><tr><td style="text-align:left;"><a href="https://github.com/Constellation/esmangle" target="_blank" rel="noreferrer">esmangle</a></td><td style="text-align:left;">Minifier for Mozilla Parser API AST</td></tr><tr><td style="text-align:left;"><a href="https://github.com/estools/estraverse" target="_blank" rel="noreferrer">estraverse</a></td><td style="text-align:left;">ECMAScript traversal functions from esmangle project</td></tr><tr><td style="text-align:left;"><a href="https://github.com/mattbierner/ecma-ast" target="_blank" rel="noreferrer">ecma-ast</a></td><td style="text-align:left;">AST node data structures for ECMAScript 5.1 based on the <a href="https://developer.mozilla.org/en-US/docs/SpiderMonkey/Parser_API" target="_blank" rel="noreferrer">SpiderMonkey Parser API</a></td></tr><tr><td style="text-align:left;"><a href="https://github.com/mason-lang/esast" target="_blank" rel="noreferrer">esast</a></td><td style="text-align:left;">Slow compilation? Use typed data for fast AST construction and rendering. Compatible with JSON trees following <a href="https://github.com/estree/estree" target="_blank" rel="noreferrer">estree</a>.</td></tr><tr><td style="text-align:left;"><a href="https://github.com/davidbonnet/astring" target="_blank" rel="noreferrer">Astring</a></td><td style="text-align:left;">Tiny and fast JavaScript code generator from an ESTree-compliant AST.</td></tr></tbody></table>',81)